INSERT INTO `master_tax` VALUES (1,1,'SR',6.00,'Standard-rated supplies with GST charged.','A GST registered supplier must charge and account GST at 6% for all sales of goods and services made in Malaysia unless the supply qualifies for zero-rating, exemption or falls outside the scope of the proposed GST model. The GST collected from customer is called output tax. The value of sale and corresponding output tax must be reported in the GST returns.','1','2018-05-07 02:56:38','2018-05-07 02:56:38',NULL),(2,1,'ZRL',0.00,'Standard-rated supplies with GST charged.','A GST registered supplier can zero-rate (i.e. charging GST at 0%) certain local supply of goods and services if such goods or services are included in the Goods and Services Tax (Zero Rate Supplies) Order 2014. Examples includes sale of fish, cooking oil.','1','2018-05-07 02:56:38','2018-05-07 02:56:38',NULL),(3,1,'ZRE',0.00,'Exportation of goods or services which are subject to zero rated supplies.','A GST registered supplier can zero-rate (i.e. charging GST at 0%) the supply of goods and services if they export the goods out of Malaysia or the services fall within the description of international services. Examples includes sale of air-tickets and international freight charges.','1','2018-05-07 02:56:38','2018-05-07 02:56:38',NULL),(4,1,'OS',0.00,'Output Tax 0% - Out Of Scope Supplies','Supplies that are outside the scope of the proposed GST model and GST is therefore not chargeable. Example: transfer of business as a going concern, private transactions, third country sales (sale of goods from a place outside Malaysia to another place outside Malaysia).','1','2018-05-07 02:56:38','2018-05-07 02:56:38',NULL),(5,1,'SR_S',6.00,'Output Tax 6% - Standard Rated Supplies','Supply of goods and services made in Malaysia that accounted for standard rated GST.','1','2018-05-07 02:56:38','2018-05-07 02:56:38',NULL),(6,2,'TX',0.00,'Purchases with GST incurred at 6% and directly attributable to taxable supplies.','This refers to goods and/or services purchased from GST registered suppliers. The prevailing GST rate is 6% w.e.f 1/4/2015. As it is a tax on final consumption, a GST registered trader will be able to claim credits for GST paid on goods or services supplied to them. The recoverable credits are called input tax. Examples include goods or services purchased for business purposes from GST registered traders.','1','2018-05-07 02:56:38','2018-05-07 02:56:38',NULL),(7,2,'OP',0.00,'Input Tax 0% - Out of Scope','Purchase of goods that are outside the scope of GST legislation.','1','2018-05-07 02:56:38','2018-05-07 02:56:38',NULL),(8,2,'TX_S',6.00,'Input Tax 6% - To Make Taxable Supplies (standard rated)','Goods and services purchased from GST registered suppliers and directly attributable to taxable supplies (standard rated). GST incurred at 6%.','1','2018-05-07 02:56:38','2018-05-07 02:56:38',NULL);
/*!40000 ALTER TABLE `master_tax` ENABLE KEYS */;
UNLOCK TABLES;

